                local function getAtributo(chave)
					if chave~=nil then
						chave = chave:upper();
					end;
                    local mod = 0;
                    if (chave == "FOR") then
                        mod = getFOR();
                    end;
                    if (chave == "DES") then
                        mod = getDES();  
                    end;
                    if (chave == "CON") then
                        mod = getCON();
                    end;
                    if (chave == "INT") then
                        mod = getINT();  
                    end;
                    if (chave == "SAB") then
                        mod = getSAB(); 
                    end;
                    if (chave == "CAR") then
                        mod = getCAR();
                    end;
					return mod;
                end;
            


