            							end;
            							local mesaDoPersonagem = rrpg.getMesaDe(sheet);
            							mesaDoPersonagem.activeChat:enviarMensagem("PV m√°ximo: " .. maximo .. "; PV m√©dio: " .. math.floor(media));
